import Github from  '../Images/github.svg'
import './Footer-module.css';

function Footer() {
  return (
    
    <footer>

        <h3 class="footer-title"> My social medias </h3>

        <div class="footer-row">
            
            <img class="footer-img pulsar" Onclick="window.location = 'https://github.com/Victor-Lis/'" src={Github} /> 
        
        </div>

    </footer>

  );
}

export default Footer;
